import React from "react";
import { Route, Routes,Redirect } from 'react-router-dom'  // Step 3
import About from './About'
import Contact from './Contact'
import User from "./User";
import Navbar from "./Navbar";
import Search from "./Search";
import EroorFound from "./ErrorPage";

const App = () => {

    let Name = () => {
        return <h1>Name Page Is Activated</h1>
    }
    return (
        <>
            <Navbar />
            <Routes>
                <Route exact path="/" Component={() => <About name='About' />} />
                <Route exact path="/contact" Component={() => <Contact name='Dil' />} />
                <Route exact path="/contact/name" Component={Name} />
                <Route  path="/user/:val/:newval" Component={() => <User />} />
                <Route exact path="/serach"  Component={Search}/>
                {/* <Route  path="*" Component={EroorFound} /> */}
                <Redirect></Redirect>

            </Routes>
        </>
    )
}


export default App;
